import { OptionsSlider } from "../profile/OptionsSlider";

function ImageTobeFilteredx({
  filterImage,
  index,
  itemUploadRef,
  setActivatefilterImage,
}: any): JSX.Element {
  const blank = () => {};

  return (
    <>
      <OptionsSlider
        typeUpload="false"
        showModalUpload={showModalUpload}
        OpenUploadModal={OpenUploadModal}
        sethaltedTop={blank}
        typeTop={false}
        getSliderWidth={getSliderWidth}
        cropTOPLEVELScrollRef={cropTOPLEVELScrollRef}
        refWithimageData={refWithimageData}
      />
    </>
  );
}

export const ImageTobeFiltered = React.memo(ImageTobeFilteredx);
